import React from 'react';
import './home.css';
import Title from './Title.js';
import ProfileImage from './ProfileImage.js';

const Home = () => (
    <div className='home'>
      <div className='backgroundColumn1'></div>
      <div className='backgroundColumn2'></div>
      <div className='backgroundColumn1'></div>
      <ProfileImage />
      <Title />
    </div>
  );

export default Home;
